import React from 'react';
import Home from './components/Home'
import Presentation from './components/presentation'
import { Header, Container } from 'semantic-ui-react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import './App.css';

function App() {
  return (
    <div>
      <br />
      <Container>
        <Header className='home' textAlign='justified'>
          <Segment size='big' textAlign='center'>Collaborateur</Segment>
          <Segment size='big' textAlign='center'>RH</Segment>
        </Header>
        {/* <Presentation /> */}
      </Container>
    </div>
  );
}

export default App;
